import React from 'react'

const Spinner = () => {
    return (
        <div>
            <div className="d-flex justify-content-center align-items-center"
            style={{height:"70vh"}}
            >
                <div className="spinner-border" role="status">
                    <span className="visually-hidden">Loading...</span>
                </div>
            </div>

        </div>
    )
}

export default Spinner
